import React from "react";
import { Container, AppBar, Typography, Grow, Grid } from '@material-ui/core';
import books from './images/books.png';

const App = () => {
    return (
        <Container maxidth="ig">
            <AppBar position="static" color="inerit">
                <Typography variant="h2" aligh="center">Books</Typography>
                <img src={books} alt="books" height="60" />
            </AppBar>
        </Container>
    );
}

export default App;
